import React from 'react';

export const SearchBox = () => {
    const [count, setCount] = React.useState(0);

    return (
      <div>
        <p>count: {count}</p>
        <button onClick={() => setCount(count + 1)}>Click</button>
      </div>
    );
   };

   export default SearchBox;
